import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import { Container, Form, Button, Card, Alert } from 'react-bootstrap';
import { login } from '../services/api';
import { toast } from 'react-toastify';

function Login() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');
    
    console.log('1. Login attempt with:', { email, password: '***' });
    
    try {
      console.log('2. Calling login API...');
      const response = await login({ email, password });
      
      console.log('3. Raw response:', response);
      console.log('4. Response data:', response.data);
      console.log('5. Response status:', response.status);
      console.log('6. Response headers:', response.headers);
      
      // Check if we have a successful response
      if (response && response.data) {
        console.log('7. Response data exists');
        
        // The response from your backend has a 'success' flag
        if (response.data.success === true) {
          console.log('8. Success flag is true');
          
          // Extract customer data
          const customerData = {
            id: response.data.id,
            customerId: response.data.customerId,
            fullName: response.data.fullName,
            email: response.data.email
          };
          
          console.log('9. Customer data to store:', customerData);
          
          // Store in localStorage
          localStorage.setItem('customer', JSON.stringify(customerData));
          console.log('10. Stored in localStorage');
          
          // Verify it was stored
          const stored = localStorage.getItem('customer');
          console.log('11. Verified stored data:', stored);
          
          toast.success('Login successful!');
          console.log('12. Toast shown, navigating to dashboard...');
          
          // Navigate to dashboard
          navigate('/dashboard');
          console.log('13. Navigation called');
        } else {
          console.log('8. Success flag is false or missing');
          console.log('9. Response message:', response.data.message);
          setError(response.data.message || 'Login failed');
          toast.error('Login failed');
        }
      } else {
        console.log('7. No response data');
        setError('Invalid response from server');
        toast.error('Login failed');
      }
    } catch (err) {
      console.error('Login error:', err);
      console.error('Error response:', err.response);
      console.error('Error data:', err.response?.data);
      console.error('Error status:', err.response?.status);
      
      const errorMessage = err.response?.data?.message || 
                          err.response?.data || 
                          err.message || 
                          'Login failed';
      
      setError(typeof errorMessage === 'string' ? errorMessage : 'Login failed');
      toast.error('Login failed');
    } finally {
      setLoading(false);
      console.log('14. Loading set to false');
    }
  };

  return (
    <Container className="mt-5">
      <Card style={{ 
        maxWidth: '400px', 
        margin: '0 auto',
        backgroundColor: '#1A1A1A',
        border: '1px solid #FFD700',
        color: '#FFFFFF'
      }}>
        <Card.Body>
          <div style={{ textAlign: 'center', marginBottom: '20px' }}>
            <img 
              src={require('../assets/logo.png')} 
              alt="Mahlangu Capital Bank" 
              style={{ width: '80px', height: '80px', borderRadius: '12px' }}
            />
            <h2 style={{ color: '#FFD700', marginTop: '10px' }}>MAHLANGU CAPITAL BANK</h2>
            <p style={{ color: '#FFFFFF', opacity: 0.7 }}>Strength. Security. Wealth.</p>
          </div>
          
          {error && <Alert variant="danger">{error}</Alert>}
          
          <Form onSubmit={handleSubmit}>
            <Form.Group className="mb-3">
              <Form.Label style={{ color: '#FFD700' }}>Email</Form.Label>
              <Form.Control
                type="email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                required
                disabled={loading}
                style={{
                  backgroundColor: '#000000',
                  border: '1px solid #FFD700',
                  color: '#FFFFFF'
                }}
              />
            </Form.Group>
            
            <Form.Group className="mb-3">
              <Form.Label style={{ color: '#FFD700' }}>Password</Form.Label>
              <Form.Control
                type="password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                required
                disabled={loading}
                style={{
                  backgroundColor: '#000000',
                  border: '1px solid #FFD700',
                  color: '#FFFFFF'
                }}
              />
            </Form.Group>
            
            <Button 
              variant="primary" 
              type="submit" 
              className="w-100"
              disabled={loading}
              style={{
                backgroundColor: '#FFD700',
                border: 'none',
                color: '#000000',
                fontWeight: '600',
                padding: '10px',
                opacity: loading ? 0.7 : 1
              }}
            >
              {loading ? 'Logging in...' : 'Login'}
            </Button>
          </Form>
          
          <div className="text-center mt-3">
            <Link to="/register" style={{ color: '#FFD700', textDecoration: 'none' }}>
              Don't have an account? Register
            </Link>
          </div>
        </Card.Body>
      </Card>
    </Container>
  );
}

export default Login;
